column8:
調理台の表面を汚れ、シミ、キズから守る！！厚手で簡単に貼れる！弱粘着でのり残りなし！人造大理石専用。<br><br>ＪＡＮ　4901987228608<br>CS：40　<p>人口大理石の調理台表面をキズつきやシミ・汚れから守る専用シートです。<br>透明なのでキッチンのイメージを損なわずキレイをキープします。<br>厚手のシートで貼りやすく、弱粘着でのり残りもないので剥がしやすく取替え簡単です。<br><br><br>〔準備〕<br>１．調理台をきれいにする。(あらかじめ油汚れ等をふき取ってください。調理台に、油汚れなどが残っていると粘着力が弱まります。)<br>２．裏紙を付けたまま、使用する大きさにハサミ等で切る。<br>３．ぬれたフキン等で、調理台の上を軽く湿らせる。<br><br><br><br>〔貼り方〕<br><br>１．シートの端から貼り付ける<br>裏紙を端から5～10cm程度めくって位置を決め、シートを調理台にピッタリと貼り付けます。<br><br><br>２．タオル等を使って裏紙をはがすように押し込みながら少しずつ貼る<br>裏紙を少しずつはがしながら貼ってください。<br>一気にはがして貼ると、シワや空気溜まりができやすやすくなります。<br>シート真ん中から外側に向かって貼るのがコツです。<br><br>３．ヘラで、水や気泡を押出す<br>付属のヘラを使って、シートと調理台との間の水や気泡をシートの外に押出します。</p><p>カラー 透明<br>本体サイズ（約） 縦55cm×横60cm／1枚入<br>パッケージサイズ（約） 縦59cm×横6cm×厚み6cm<br>重量（約） 87g<br>付属品 へら付き<br>素材 ポリエステルフィルム<br>原産国 日本</p><p>メーカー：東洋アルミエコープロダクツ <br>材質：ポリエステルフィルム</p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
